let asignatura = [
    {
        nombre: "Calculo",
        dia: "Martes- Jueves",
        horario: "13:00-15:00",
        ubicacion: "meet",
        descripcion: "Calculo para estudiantes que requieran asesoría, nos vemos por la plataforma meet",
        foto: require('../components/img/calculo.jpg'),
    },
    {
        nombre: "Logica",
        dia: "Lunes- Miercoles",
        horario: "15:00-17:00",
        ubicacion: "meet",
        descripcion: "Lógica para estudiantes que requieran asesoría, nos vemos por la plataforma meet",
        foto: require('../components/img/logica.png'),
    },
];

export const getAsignatura = () => asignatura;
export const setAsignatura = (nuevaAsignatura) => asignatura.push(nuevaAsignatura);
